import React from 'react'




const arr= [
    {
        name : 'zahid',
        Fname : 'ghafoor',
        class : 'I.T',
        Rollno : '406',
        school : 'Pakistan'
    },
    {
        name : 'tata',
        Fname : 'saleem',
        class : 'Bsc',
        Rollno : '420',
        school : 'India'
    },
    {
        name : 'jin',
        Fname : 'rand',
        class : 'I.t',
        Rollno : '455',
        school : 'kasur'
    },
    {
        name : 'Junaid',
        Fname : 'Latif',
        class : 'I.T',
        Rollno : '500',
        school : 'Kaisar'
    },
    
]



const Map = () => {
    return (
        <>
        <div className="hlo">
        <h1>Your first name is {arr[0].name} </h1>
        <h1>Your Last name is {arr[0].Fname} </h1>
        <h1>Your class is {arr[0].class} </h1>
        <h1>Yor roll no is {arr[0].Rollno} </h1>
        <h1>Your City name is {arr[0].school} </h1>
        </div>
        </>
    )
}

export default Map
